import { CardView } from '@/components/CardView';
import { useNavigation } from '@react-navigation/native'; // For navigation
import Ionicons from 'react-native-vector-icons/Ionicons'; // For the back arrow icon
import { Link } from 'expo-router';
import { useLocalSearchParams } from 'expo-router';

export default function ExplorePage() {
  const [groceries, setGroceries] = useState<any[]>([]);
  const [searchQuery, setSearchQuery] = useState('');
  const { id } = useLocalSearchParams<{ id: string }>();

  // Sample data to represent grocery items
  const sampleGroceries = [
    { id: 1, name: 'Apple', price: 250, imageUrl: 'https://hbkonline.in/pub/media/catalog/product/a/p/apple_fruit_powder3.jpg', categoryId: '1' },
    { id: 2, name: 'Banana', price: 100, imageUrl: 'data:image/jpeg;base64,', categoryId: '1' },
    { id: 3, name: 'Carrot', price: 70, imageUrl: 'data:image/jpeg;base64,', categoryId: '1' },
    { id: 4, name: 'Milk', price: 50, imageUrl: 'https://kanma.in/wp-content/uploads/2023/08/Glass-and-bottle-of-milk-fe0997a.jpg', categoryId: '1' },
    { id: 5, name: 'Eggs', price: 100, imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTBEboP2coyhTXQNxAopsPcl0cCBTVr3g9pyQ&s', categoryId: '1' },
    { id: 6, name: 'Bread', price: 50, imageUrl: 'data:image/jpeg;base64,', categoryId: '1' },
    { id: 7, name: 'Orange', price: 100, imageUrl: 'data:image/jpeg;base64,', categoryId: '2' },
    { id: 8, name: 'Strawberries', price: 150, imageUrl: 'data:image/jpeg;base64,', categoryId: '2' },
    { id: 9, name: 'Yogurt', price: 70, imageUrl: 'data:image/jpeg;base64,', categoryId: '2' },
    { id: 10, name: 'Cheese', price: 182, imageUrl: 'data:image/jpeg;base64,', categoryId: '2' },
    { id: 13, name: 'Rice', price: 300, imageUrl: 'https://www.health.com/thmb/a8GxwWgmB5KpQW8SfW6VA7UFwaI=/722x0/filters:no_upscale():max_bytes(150000):strip_icc()/GettyImages-1734160670-0157c2daf8e841d6a783b38aedc51aa8.jpg', categoryId: '3' },
    { id: 14, name: 'Pasta', price: 60, imageUrl: 'data:image/jpeg;base64,', categoryId: '3' },
    { id: 15, name: 'Tomatoes', price: 50, imageUrl: 'data:image/jpeg;base64,', categoryId: '4' },
    { id: 16, name: 'Onions', price: 80, imageUrl: 'data:image/jpeg;base64,', categoryId: '4' },
    { id: 17, name: 'Lettuce', price: 110, imageUrl: 'data:image/jpeg;base64,', categoryId: '4' },
    { id: 18, name: 'Potatoes', price: 50, imageUrl: 'data:image/jpeg;base64,', categoryId: '4' },
    { id: 19, name: 'Peanut Butter', price: 300, imageUrl: 'data:image/jpeg;base64,', categoryId: '5' },
    { id: 20, name: 'Jam', price: 155, imageUrl: 'data:image/jpeg;base64,', categoryId: '5' },
  ];

  // Set groceries on mount
  useEffect(() => {
    setGroceries(sampleGroceries);
  }, []);

  // Filter groceries based on the search query
  const filteredGroceries = groceries.filter((item) =>
    item.name.toLowerCase().includes(searchQuery.toLowerCase())
  );

  // Get category name based on the `id`
  const categoryName = groceries.length > 0 ? `${id}` : 'Groceries';

  return (
    <SafeAreaView style={styles.container}>
      <ScrollView style={styles.scrollView} contentContainerStyle={styles.contentContainer}>
        {/* Header with back arrow */}
        <View style={styles.header}>
          <Link href="/(tabs)" style={styles.backButton}>
            <Ionicons name="arrow-back" size={24} color="#fff" />
          </Link>
          <Text style={styles.title}>{categoryName}</Text>
        </View>

        {/* Search bar */}
        <TextInput
          style={styles.searchBar}
          placeholder="Search groceries..."
          placeholderTextColor="#888"
          value={searchQuery}
          onChangeText={setSearchQuery}
        />

        {/* Display the groceries using FlatList and CardView */}
        <FlatList
          data={filteredGroceries}
          keyExtractor={(item) => item.id.toString()}
          renderItem={({ item }) => (
            <CardView
              href={item.imageUrl}
              title={item.name}
              price={item.price}
              id={item.id}
              style={styles.card}
            />
          )}
          contentContainerStyle={styles.flatListContainer}
          numColumns={2} // Display items in 2 columns
        />
      </ScrollView>
    </SafeAreaView>
  );
}

